import React from "react";


const Projects =  () => {
    return(
        <>
        <h1 className="tc white">Projects</h1>
        <div className="project_1">
        <h2 className="white">Debut Python Project: Video Downloads & Music Playback </h2>
        <p className="white">My debut Python project introduces me to programming. It employs a library for hassle-free video downloads from links. The user-centric GUI empowers users to pick folders for downloads or music playback. MP3s can be directly saved or played in the chosen folder. Future enhancements paused to prioritize other projects.</p>
        <br />
        <p><a>Press to go to the Github page...</a></p>
        </div>
        </>
    )
}

export default Projects;
